  }

  return (
    <div className='container'>
      <form onSubmit={handleSubmit}>
        <h1>Login Form</h1>
        <div clasName="ui divider"></div>
        <div className="ui form"></div>
        <div className="field">
        <label>Имя Фамилия</label>
        <input 
        type="text" 
        name="username" 
        plceholder="Username" 
        value={ formValues.username}
        onChange={handleChange}
        />
        </div>
        <div className="field">
        <label>E-mail</label>
        <input 
        type="email" 
        name="email" 
        plceholder="Email" 
        value={ formValues.email}
        onChange={handleChange}
        />
        </div>
        <div className="field">
        <label>Номер телефона</label>
        <input 
        type="tel" 
        name="tel" 
        plceholder="tel" 
        value={ formValues.tel}
        onChange={handleChange}
        />
        </div>
        <div className="field">
        <label>Дата рождения</label>
        <input 
        type="date" 
        name="date" 
        plceholder="date" 
        value={ formValues.date}
        onChange={handleChange}
        />
        </div>
        <div className="field">
        <label>Сообщение</label>
        <input 
        type="text" 
        name="message" 
        plceholder="message" 
        value={ formValues.message}
        onChange={handleChange}
        />
        </div>
      </form>
    </div>
  );
}

export default App;
